import { AboutCardProps } from "@/types";
import Image from "next/image";

const AboutCard: React.FC<AboutCardProps> = ({
  img,
  title,
  des,
  btn,
  btnClass,
}) => {
  return (
    <div className="h-[275px] w-[550px] bg-[#1F2937] rounded-xl flex flex-col items-start gap-2 p-4">
      <Image
        src={img}
        alt="None"
        height={100}
        width={100}
        className="object-cover rounded-xl h-[160px] w-[490px]"
      />
      <p className="text-white text-sm space-grotesk mt-1">{title}</p>
      <p className="text-sm text-[#9CA3AF] space-grotesk">{des}</p>
      <button className={`font-medium text-sm space-grotesk ${btnClass}`}>
        {btn}
      </button>
    </div>
  );
};

export default AboutCard;
